import React from 'react';

export default function Carousel() {
    return (
        <div>
            {/* Search Bar */}

            {/* Carousel */}
            <div id="carouselExampleFade" className="carousel slide carousel-fade" data-bs-ride="carousel">
                <div className="carousel-inner">
                <div className="carousel-item active">
                <img src="https://www.foodandwine.com/thmb/DI29Houjc_ccAtFKly0BbVsusHc=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/crispy-comte-cheesburgers-FT-RECIPE0921-6166c6552b7148e8a8561f7765ddf20b.jpg" style={{ filter: "brightness(30%)" }} className="d-block w-100" alt="..." />
                </div>
                <div className="carousel-item">
                <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/a/a1/Momo_nepal.jpg/1200px-Momo_nepal.jpg" style={{ filter: "brightness(30%)" }} className="d-block w-100" alt="..." />
                </div>
                <div className="carousel-item">
                <img src="https://hips.hearstapps.com/hmg-prod/images/classic-cheese-pizza-recipe-2-64429a0cb408b.jpg?crop=0.8888888888888888xw:1xh;center,top&resize=1200:*" style={{ filter: "brightness(30%)" }} className="d-block w-100" alt="..." />
                </div>
                <div className='carousel-indicators'>
                    <form className="d-flex">
                        <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
                        <button className="btn btn-outline-success text-white bg-success" type="submit">Search</button>
                    </form>
                </div>
                </div>
                // <button className="carousel-control-prev" type="button" data-bs-target="#carouselExampleFade" data-bs-slide="prev">
                //     <span className="carousel-control-prev-icon" aria-hidden="true"></span>
                //     <span className="visually-hidden">Previous</span>
                // </button>
                // <button className="carousel-control-next" type="button" data-bs-target="#carouselExampleFade" data-bs-slide="next">
                //     <span className="carousel-control-next-icon" aria-hidden="true"></span>
                //     <span className="visually-hidden">Next</span>
                // </button>
            </div>
        </div>
    );
}
